import React from 'react'
import { connect } from 'react-redux'
import Query from './query'
import QueryTable from './query-table'

const getURLParameter = (name: string) =>
    decodeURIComponent((new RegExp(`[?|&]${name}=([^&;]+?)(&|#|;|$)`).exec(location.search) || [null, ''])[1].replace(/\+/g, '%20')) || null

interface IdentityProps {
  username: string
}

export class Main extends React.Component<IdentityProps>{
  constructor(props: any) {
    super(props)
    this.state = {

    }
  }

  public static defaultProps = {
    username: '',
  }

  render() {
    console.log("main")
    if (this.props.username ) {
      return (
        <>
          <div className="">
            <Query />
          </div>
          <div>
            <QueryTable qTitle={getURLParameter('qTitle')}/>
          </div>
        </>
      )
    } else {
      return (
        <div>
          <p>You are not logged in.</p>
        </div>
      )
    }
  }

}

const mapStateToProps = ({ user: { username }}:any) => ({
  username,
})

export default connect<any>(mapStateToProps,)(Main)
